import React from "react";
import "./App.css";
import logo from "./Pitchdeck - daimon.AI .png"; // Make sure this matches the file name

function App() {
  return (
    <div className="App" style={styles.container}>
      <img src={logo} alt="Daimon Logo" style={styles.logo} />
      <input
        type="text"
        placeholder="Search..."
        style={styles.searchbar}
      />
    </div>
  );
}

const styles = {
  container: {
    textAlign: "center",
    backgroundColor: "#f4f4f9", // light grayish background
    height: "100vh",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
  },
  logo: {
    height: "180px",
    marginBottom: "30px",
    opacity: 0.95,
  },
  title: {
    fontSize: "3rem",
    fontWeight: "600",
    marginBottom: "25px",
    color: "#1f1f3d",
  },
  searchbar: {
    padding: "12px 24px",
    fontSize: "1rem",
    borderRadius: "12px",
    border: "1px solid #ccc",
    outline: "none",
    width: "320px",
    maxWidth: "90%",
    boxShadow: "0 2px 6px rgba(0,0,0,0.1)",
  },
};

export default App;
